package com.sugon.humanface_opencv.utils;import java.util.Random;/** * Description: * Author     : Dawn.Ji * Date       : Created in 11:43 2018/11/8 */public final class KeyUtil {    /**     * 生成唯一的主键     * 格式: 时间+随机数     * @return     */    public static synchronized String genUniqueKey() {        Random random = new Random();        Integer number = random.nextInt(900000) + 100000;        return System.currentTimeMillis() + String.valueOf(number);    }}